  [11043]="Der Scharlachrote Kreuzzug wird hier nicht sein Ende finden! Ihr werdet unsere Reihen nicht durchbrechen!",
  [11056]="Die Lösung steht in meinem Kessel bereit. Man muss einfach nur den unvollendeten Schlüssel und den Skarabäus damit behandeln.",
  [11075]="Fleisch von Mensch... muss essen!",
  [11076]="Die Geißel ruft Euch, dumme Draenei.",
  [11077]="Wer wagt es, sich diesem Kessel zu nähern? Kostet meine dunkle Klinge!",
  [11218]="Es ist still... Zu still...",
  [11261]="Der Doktor ist da!",
  [11380]="Willkommen zu Eurem Begräbnis! Tretet vor und sterbt!",
  [11382]="&lt;name&gt;! Ich behalte Euch im Auge!",
  [11440]="Ich werde Euch vernichten!",
  [11582]="Oje, dieser hier ist aber auch für absolut gar nichts zu gebrauchen. Ich versuche es noch mal.",
  [11715]="Bitte werft einen Blick auf diese Schlangenstrunkranke, die ich in der Höhle gepflückt habe, damit Ihr wisst, wonach Ihr suchen müsst, &lt;name&gt;...",
  [11793]="Nichts darf die Gärten beschmutzen! Ihr müsst vernichtet werden!",
  [11946]="Ihr könnt den Frostwolfklan nicht besiegen!",
  [11947]="Darauf falle ich nicht rein, Dummkopf! Wenn Ihr einen Kampf wünscht, wird er nach meinen Bedingungen und in meinem Unterschlupf erfolgen!",
  [12580]="Wie es vor langer Zeit in Karazhan vorherbestimmt wurde, Monster - ich komme - und ich bringe Gerechtigkeit.",
  [12936]="Auf Wiedersehen, grausame Welt... Ich verlasse dich heute... auf Wiedersehen... auf Wiedersehen... auf Wiedersehen...",
  [12938]="Gehirn zerstört... Mörser... kap... putt... läuft aus... ster...be...",
  [12997]="In den Kasten, meine Süßen! Genau so. Einer nach dem anderen.",
  [13181]="Ich mache dich fertig, du kümmerliche Allianz!",
  [13257]="Danke für die Vorräte, &lt;name&gt;!",
  [13437]="Und abwärts, Mulv!",
  [13716]="Bitte richtet Euch nach meinen Anweisungen, &lt;name&gt;.",
  [14354]="STIRB! Du bringst Pusillin zum weinen!",
  [14507]="Möge das Schlachten beginnen!",
  [14509]="Hakkar kontrolliert mich nicht länger! Endlich Frieden!",
  [14510]="Seid gesegnet für meine Befreiung, Sterbliche... Hakkar beherrscht mich nicht länger!",
  [14515]="Die Macht des Seelenschinders fällt von mir!",
  [14517]="Ah...der Tod! Ich verfluche Euch, Hakkar! Ich verfluche Euch!",
  [14834]="EURE ÜBERHEBLICHKEIT KÜNDET BEREITS VOM ENDE DIESER WELT! KOMMT STERBLICHE - STELLT EUCH DEM ZORN DES SEELENSCHINDERS!",
  [14887]="Tretet vor, ihr Träumer, und nehmt eure Rache!",
  [15339]="Ich... habe... versagt.",
  [15341]="Haucht Euren letzten Atemzug aus!",
  [15402]="Solch... dunkle... Energie! Wie ist das möglich?",
  [15420]="Was für eine Art Trick ist dies, Blutelf? Ich warne Euch: wenn Ihr mich überfallen wollt, werde ich mich nach Kräften wehren.",
  [15941]="Was? Oh nein, nicht schon wieder!",
  [15942]="Haltet die Stellung!",
  [15945]="Das könnt Ihr mir nicht antun! Wir hatten eine Abmachung!",
  [15951]="Auf Nimmerwiedersehen! Nun sollte niemand in der Lage sein, meine Fehler zu wiederholen.",
  [16144]="Oh, ganz bestimmt, Elisara. Bitte, nur noch ein klein wenig Geduld.",
  [16162]="Die Schmerzen... das Verlangen... ich brauche mehr...",
  [16196]="Ihr geht erstmal nirgendwo hin, Schätzchen. Nicht bevor Ihr Euch wieder vollends erholt habt.",
  [16206]="Ich da... danke Euch. Ich dachte ich müsste sterben.",
  [16208]="Danke, ich hätte den Silberwald niemals verlassen sollen.",
  [16209]="Da... Dank Euch. Ich war mir sicher, dass ich sterben werde.",
  [16220]="Lilatha, jemand soll sich diese Verletzungen ansehen. Ich danke Euch, dass Ihr sie sicher zurückgebracht habt.",
  [16295]="Hauptmann Helios, man hat mich aus den Amanikatakomben gerettet. Melde mich zum Dienst, Sir!",
  [16329]="Sterbliche Narren! Die Ghuls der Todesfestung werden sich an euren Überresten laben!",
  [16483]="Aaagggh... Wo bin ich? Ist das alles, was vom Schiff übrig ist?",
  [16514]="Nur zu Tedon, probiert den Neutralisierungswirkstoff an den mutierten Kreaturen aus.",
  [16521]="Ich hoffe, Ihr habt Euren Frieden gemacht.",
  [16522]="Mich bekommt Ihr nicht lebend, Abschaum!",
  [17214]="Es scheint, als sei diese Salbe wirkungslos. Schade...",
  [17215]="Das sollte funktionieren...",
  [17233]="Bitte, erhebt Euch mein Freund. Behaltet den Segen als ein Symbol für die Stärke des Lichts und dafür, dass längst verstorbene Helden in unseren Herzen wiederauferstehen, um uns alle zu inspirieren.",
  [17238]="Achtung! Wir werden angegriffen!",
  [17240]="Hey, Kräcka! Was gibt's heute zum Abendessen? Sag' bloß nicht Hühnchen!",
  [17241]="Adamant, könntet Ihr bitte einen Blick auf diese Tafel werfen und versuchen, die Runen zu entziffern?",
  [17242]="Gut, dann sehe ich mir mal die Schrifttafel an.",
  [17243]="Lebt in Angst oder sterbt durch den Willen Kael'thas'... es kommt auf das Gleiche heraus.",
  [17246]="Es gibt Hühnchen...",
  [17312]="Du kannst &lt;name&gt; dafür danken, dass sie mich sicher hier her gebracht hat, Vater.",
  [17359]="Was habt Ihr meinem Lebenswerk angetan?! STERBT!!!",
  [17375]="[Furbolg] Die Furbolgs der Tannenruhfeste werden Eure Tapferkeit nicht so schnell vergessen!",
  [17393]="[Furbolg] Folgt mir zu Vark.",
  [17424]="Aber egal. Abgesehen von Herrn Clementines, äh, 'Beitrag', scheint dies das Tagebuch einer Person namens Nolkai zu sein. Die Einträge am Ende beschreiben eine brutale Schlacht.",
  [17433]="Diese Bilder scheinen eine Geschichte zu erzählen. Die Figur am Anfang sieht vertraut aus... fast wie eine der Kreaturen, auf die wir bei der Azurwacht getroffen sind...",
  [17445]="Kämpfer der Tannenruhfeste, die Zeit zum Angriff ist gekommen! Attacke!",
  [17509]="Lest den Folianten der Offenbarung, den ich Euch gegeben habe, &lt;name&gt;. Wenn Ihr aus dem Buch gelernt habt, redet wieder mit mir.",
  [17658]="Lang lebe &lt;name&gt;, der Retter der Azurmythos- und Blutmythosinsel. Held der Hand von Argus und Champion der Draenei!",
  [17804]="Man hat Bescheid gegeben. Er sollte in Kürze hier sein.",
  [17807]="Champion Lichtrend, macht mich stolz!",
  [17824]="Verräterischer Wurm! Sironas wird Euch und Euer Volk vernichten!",
  [18338]="Azeroth konnte sich zu lange vor unserem Schatten verstecken! Nun spürt die Macht des Brennenden Kreuzzuges und verzweifelt!",
  [18810]="Wenn du deinen Fisch nicht isst, gibt es keinen Pudding!",
  [23566]="Es wäre doch eine wahre Schande, wenn diese Handzettel auf dem Müll landen würden, oder?",
  [23569]="Hey... was ist das? Fesseln... und zwar ganz bestimmte. Diese hier sind verzaubert. Bei der Fracht handelte es sich nicht um einen Gegenstand... sondern um eine Person!",
  [23600]="Dumme &lt;class&gt;... verbrauchen alle Reagenzien und besorgen nie Ersatz.",
  [23602]="Die Leute werden Admiral Prachtmeer als den Helden kennen, der er wirklich war!",
  [23720]="Vielen Dank! Wer weiß, was diese Wahnsinnigen noch mit mir gemacht hätten.",
  [23786]="Ich töten erbärmlichen Drachenfreund!",
  [23789]="Eure lächerliche Herausforderung wurde zur Kenntnis genommen. Es wird mir viel Freude bereiten mit Euch zu spielen, bevor ich Euch einem langsamen Tod überantworte!",
  [23843]="Ich bin hierher gekommen, um dich zu besuchen, Jarl! Und was finde ich? Dich, in einer leeren Hütte mitten im Nirgendwo, wie du über Frösche plapperst? Ich geb's auf!",
  [23861]="Die Dunkelheit wird alles verzehren... alles, was lebt...",
  [23864]="Dieses Land gehörte mir, schon lange bevor Euer bemitleidenswertes Volk hier Fuß gefasst hat.",
  [23896]="Ihr solltet besser etwas Abstand halten. Das Ausnehmen von Fischen ist eine unschöne Angelegenheit.",
  [23900]="Wir haben das Meeresungeheuer besiegt!",
  [23905]="FEUER NACH EIGENEM ERMESSEN!",
  [23941]="Ich gebe auf! Senkt Eure Waffen!",
  [23995]="Ich widerspreche nur ungern, aber wenn Ihr mich fragt, seid ihr Oger einfach nur zu groß! Ich sehe schon, heute werde ich Euch wohl nicht zu einem Umzug bewegen können. Aber glaubt nicht, dass Ihr auf ewig hier wohnen könnt!",
}
